import React from "react";
import { useLocation } from "react-router-dom";

export default function DetailPage() {
  const waterBrand = useLocation().state.waterBrand;

  return (
    <>
      <h1>디테일 만드는 중 ㅜㅅㅜ</h1>
      <h2>외않되</h2>
      <h2>오 된다...!!!</h2>
      <h3>{waterBrand.name}</h3>
    </>
  );
}
